$('[data-toggle="tooltip"]').tooltip();

function setTooltip(btn, message) {
  $(btn).tooltip('hide').attr('data-original-title', message).tooltip('show');
}

function hideTooltip(btn) {
  setTimeout(function () {
    $(btn).attr('data-original-title', 'Copy me').tooltip('hide');
  }, 1000);
}

const clipboard = new ClipboardJS('.copy__btn');
clipboard.on('success', function (e) {
  setTooltip(e.trigger, 'Copied!');
  hideTooltip(e.trigger);
});
clipboard.on('error', function (e) {
  setTooltip(e.trigger, 'Failed!');
  hideTooltip(e.trigger);
});
$(document).ready(function () {
  $(".faq__list__item-link").click(function (e) {
    e.preventDefault();
    $(this).closest(".faq__list__item").toggleClass("active").siblings().removeClass("active");
  });
});
$(document).ready(function () {
  $(document).scroll(function () {
    var scrollHeight = $(document).scrollTop();

    if (scrollHeight > 120) {
      $(".header").addClass("is-shrunk");
      $(".header__cta-btn, .header__nav").addClass("off");
    } else {
      $(".header").removeClass("is-shrunk");
      setTimeout(function () {
        $(".header__cta-btn.off, .header__nav.off").removeClass("off");
      }, 500);
    }
  });
  $(".header__responsive__icon").click(function () {
    $("body").addClass("is-menu-opened");
  });
  $(".header__menu__close-btn").click(function () {
    $("body").removeClass("is-menu-opened");
  });
});
window.addEventListener("hashchange", function (e) {
  e.preventDefault();
  const url = location.hash.substr(1);
  const target = document.querySelector(`.${url}`).offsetTop - 60;
  window.scrollTo({
    top: target,
    left: 0,
    behavior: 'smooth' // => 滑動效果

  });
});
